import "./NavBar.css"
import Model from "./Model";
import React, { useEffect } from 'react'
import { useState } from "react";
import Board from "./Board";
import './Board.css'
import Help from "./help";
import axios from 'axios'
import './inputbox.css'
import Placeholder from "./placeholder.js";
import './placeholder.css'





function App() {


const [GameStat, SetGameStat] = useState(false)
const [Attempts, SetAttempts] = useState(0)
const [divnum, setDiv] = useState(1)


const [isOpen, setIsOpen] = useState(false)
const [isOpen2, setIsOpen2] = useState(false)

const [tweets, setTweet] = useState()
const [answer, setAnswer] = useState()
const [answer2,setAnswer2] = useState()
useEffect(() => {

axios.get('http://localhost:4000/').then(res => {


setTweet(res.data.data.id)
setAnswer(res.data.includes.users[0].name)
setAnswer2(res.data.includes.users[0].username)
})
.catch(err => {
  console.log(err)
})


}, [])




 function getData(val)
  {

    if(val === answer)
    {
      console.log('you are right!')

      return
    }
    if(val === answer2)
    {
      console.log('you are right')

      return 
    }
    if(val !== answer)
    {
      SetAttempts(Attempts + 1)
      if(Attempts < 4)
      {

       let number = '' + divnum
       let div = 'div'


      document.getElementById(div + number).innerHTML = val

       setDiv(divnum + 1)
        return
      }


    }
    if(val !== answer2)
    {
      SetAttempts(Attempts + 1)

      if(Attempts < 4)
      {


       let number = '' + divnum
       let div = 'div'



       document.getElementById(div + number).innerHTML = val

       setDiv(divnum + 1)

        return
      }



    }
   if(Attempts > 4)
   {
    console.log("you lose")

    SetAttempts(0)
    SetGameStat(true)

    return
   }
   return
  }

function handleKeyPress(event)
{
if (event.key === 'Enter')
{
  let ansStore = document.getElementById('input').value

  getData(ansStore)
}
else
{

  console.log('keep going')
}




}

