       <Model open={isOpen} onClose={() => setIsOpen(false)}>
      </Model>
        </div>



    </div>

    <Board number = {tweets}></Board>
    <div className="wrapper">
    <input id='input' type= "text" onKeyDown={handleKeyPress}/>
    </div>
    <div className="placewrap">

    <div className="box" id="div1"></div>
    <div className="box" id="div2"></div>
    <div className="box" id="div3"></div>
    <div className="box" id="div4"></div>
    <div className="box" id="div5"></div>
    </div>
    </>

  );
}



export default App;
